import React from 'react'

const MovieCard = ({ data }) => {
    return (
        <div class="bg-white rounded-lg border p-4 ">
            <img src={data.moviemainphotos} alt={data.movietitle} class="w-full h-48 rounded-md object-cover" />
            <div class="px-1 py-4 overflow-auto">
                <div class="font-bold text-xl mb-2">{data.movietitle}</div>


                <p class="text-gray-700 text-base">
                    {data.movielanguages.map((item) => (
                        <span class="me-2">
                            {item}
                        </span>
                    ))}
                </p>

            </div>
        </div>
    )
}

export default MovieCard
